import React from "react";
import { useState, useEffect } from "react";    
import Axios from "axios";
import Swal from "sweetalert2";

function RegistrarInsumo(){
    const [nombresCliente, setNombres] = useState("");
    const [apellidosCliente, setApellidos] = useState("");
    const [rutCliente, setRut] = useState("");
    const [emailCliente, setEmail] = useState("");
    const [telefonocliente, setTelefono] = useState("");
    const [tipoInsumosList, setTipoInsumos] = useState([]);
    const token = localStorage.getItem('token');
    const [show, setShow] = useState(false);
    const handleClose = () => setShow(true);


    useEffect(() => {
        listaTipoInsumos();
    }, []);

    const limpiarCampos = () => {
        setRut("");
        setNombres("");
        setApellidos("");
        setTelefono("");
        setEmail("");
        setRut("");
      };
    const listaTipoInsumos = async()=>{
        await Axios.post("http://localhost:8010/api/tipoInsumos",{headers:{'Content-Type':'application/json','Authorization': token}})
        .then((response) => {setTipoInsumos(response.data);})
        .catch((error) => {console.error("Hubo un error al obtener la lista de tipos de Insumos:", error.response);});
    }

    const registrarCliente = async() => {
        const datosCliente = {
            rut: rutCliente,
            nombres: nombresCliente,
            apellidos: apellidosCliente,
            telefono: telefonocliente,
            email: emailCliente,
        }
        console.log(datosCliente)
        await Axios.post("http://localhost:8010/api/clientes",datosCliente,{headers:{'Content-Type':'application/json','Authorization': token}})
        .then(() => {
            limpiarCampos();
            setShow(false);
            Swal.fire({title: "<strong>Atención</strong>",
                html:"<i>El cliente fue registrado con éxito!!</i>",
                icon: "success",
                timer: 3000,
            });
        })
        .catch((error) => {
            Swal.fire({
                title: "<strong>Error</strong>",
                html: "<i>Atención: Hubo un problema al registrar el Cliente</i>",
                icon: "error",
                timer: 3000,
            });
            console.error("Hubo un error al registrar:", error.response);
        });
    };
    return(
    <div className='card'>
        <div className='card-header'>
            <h3><span className='fa fa-cubes'></span>&nbsp;Registrar Insumos</h3>
        </div>
        <div className='card-body'>
            <div className="row">
                <div className="col-sm-12 col-md-12 col-lg-12">
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-barcode"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="codigo" name="codigo" type="text" placeholder="Código" class="textosCajas textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-info-circle"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="fname" name="name" type="text" placeholder="Descripción" class="textosCajas2 textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-shopping-basket"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="cantidad" name="name" type="cantidad" placeholder="Cantidad" class="textosCajas textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required max={4}/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-usd"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="pcompra" name="pcompra" type="number" placeholder="Precio Compra" class="textosCajas textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required max={6}/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-usd"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="pventa" name="pventa" type="number" placeholder="Precio Venta" class="textosCajas textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required max={6}/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-flask"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="pventa" name="pventa" type="number" placeholder="Precio Venta" class="textosCajas textosNormal text-uppercase"
                            onChange={(event) => {setNombres(event.target.value);}} required max={6}/>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'></div>
                        <div className="col-sm-8 col-md-8 col-lg-8 text-center">
                            <button type="submit" className="botonAccion" onClick={registrarCliente}><h5><span className="fa fa-floppy-o"></span></h5>&nbsp;REGISTRAR</button>
                        </div>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'></div>
                    </div>
                </div>
            </div>
        </div>
    </div>
    )
}

export default RegistrarInsumo
